sys_variable_value.value:
(function execute(inputs, outputs) {
var did = inputs.domSysID;
var tname = inputs.tableName;

var agg = new GlideAggregate(tname);
agg.addAggregate('COUNT', 'create_date');
//agg.addAggregate('SUM', 'record_count');
agg.addQuery('sys_domain=' + did);
agg.query();
while (agg.next()) {
    //do things on the results
    var recordCount = agg.getAggregate('COUNT', 'create_date');
    //var recordSum = agg.getAggregate('SUM', 'record_count');
    //gs.info('Display the count {0}', [recordSum]);
    //outputs.newcount = recordSum;
}



outputs.record_count = recordCount;


})(inputs, outputs);

